window.bookSummaryJSON = "<p><b>The last member of a murdered House tries to protect his ward from forced marriage to a monster while uncovering clues to his own tortured past. </b></p> <p>The Tarot Sequence imagines a modern-day Atlantis off the coast of Massachusetts, governed by powerful Courts based on the traditional Tarot deck.&nbsp;</p> <p>Rune Saint John, last child of the fallen Sun Throne, is backed into a fight of high court magic and political appetites in a desperate bid to protect his ward, Max, from a forced marital alliance with the Hanged Man.</p> <p>Rune's resistance will take him to the island's dankest corners, including a red light district made of moored ghost ships; a surreal skyscraper farm; and the floor of the ruling Convocation, where a gathering of Arcana will change Rune's life forever.</p>"; 
